import React from "react";
import Card from "./card";
import "./styles.css";

const cardStyling ={
    height: "calc(100vh - 4rem)",
    width:"100vw",
    maxWidth: "75rem",
    padding: "1rem 2rem",
    overflow: "hidden",
    margin: "0 auto",
    position: "relative",
    color: "white",
}
function Stuff() {
  return (
    <div className="card-comn" style={cardStyling}>
      <Card
        url="https://giphy.com/embed/62tGXpMH900jbKnyUK"
        alignment="left"
        key={1}
        name="My Projects"
      />
      <Card
        url="https://giphy.com/embed/kFd76qcrqQK6qefgXK"
        alignment="right"
        key={2}
        name="My Blogs"
      />
    </div>
  );
}

export default Stuff;
